void NativeTracematch::registerModule(
    jsi::Runtime &rt, std::shared_ptr<react::CallInvoker> callInvoker) {
  auto invoker =
      std::make_shared<uniffi_runtime::UniffiCallInvoker>(callInvoker);
  auto tm = std::make_shared<NativeTracematch>(rt, invoker);
  auto obj = rt.global().createFromHostObject(rt, tm);
  rt.global().setProperty(rt, "NativeTracematch", obj);
}

void NativeTracematch::unregisterModule(jsi::Runtime &rt) {
  uniffi::tracematch::registry::clearRegistry();
}

